// App.js
import React, { useState } from 'react';

import Overview from './components/Overview';
import Storage from './components/Storage';
import Reports from './components/Reports';
import Settings from './components/Settings';
import Header from './components/Header';
import Help from './components/Help';
import FAQ from './components/FAQ';
import About from './components/About';
import './App.css';


function App() {
  const [activeSection, setActiveSection] = useState('overview');

  const handleMenuClick = (section) => {
    setActiveSection(section);
  };

  return (
    <div className="container">
      <Header />
      <div className="App-body">
        <aside className="sidebar">
          <nav className="menu">
            <ul>
              <li onClick={() => handleMenuClick('overview')} id="dashboardBtn">Dashboard</li>
              <li onClick={() => handleMenuClick('storage')} id="storageBtn">Storage</li>
              <li onClick={() => handleMenuClick('reports')} id="reportsBtn">Reports</li>
              <li onClick={() => handleMenuClick('settings')} id="settingsBtn">Settings</li>
            </ul>
          </nav>
          <nav className="footer-menu">
            <ul>
              <li onClick={() => handleMenuClick('help')} id="helpBtn">Help</li>
              <li onClick={() => handleMenuClick('faq')} id="faqBtn">FAQ</li>
              <li onClick={() => handleMenuClick('about')} id="aboutBtn">About Us</li>
            </ul>
          </nav>
        </aside>
        <main className="main-content">
          {activeSection === 'overview' && <Overview />}
          {activeSection === 'storage' && <Storage />}
          {activeSection === 'reports' && <Reports />}
          {activeSection === 'settings' && <Settings />}
          {activeSection === 'help' && <Help />}
          {activeSection === 'faq' && <FAQ />}
          {activeSection === 'about' && <About />}
        </main>
      </div>
    </div>
  );
}

export default App;
